export const actionTypes = {
  FAILURE: 'FAILURE',
  INCREMENT: 'INCREMENT',
  DECREMENT: 'DECREMENT',
  RESET: 'RESET',
  LOAD_DATA:'LOAD_DATA',
  FETCH_USER_LIST_SUCCESS:'FETCH_USER_LIST_SUCCESS',
};

export function fetchUserListSuccess (payload) {
  return {
    type: FETCH_USER_LIST_SUCCESS,
    payload
  };
}
